pragma solidity >=0.4.21 <0.6.0;

import './Interaction.sol';

contract Person {
  struct PersonInfo {
    string firstName;
    string secondName;
    string email;
    uint id;
    string passportData;
  }

  Interaction internal interactionContract;

  address internal owner;
  address internal allowedContract;
  PersonInfo internal personInfo;

  constructor(address _owner, address _interactionContractAddress) public {
    owner = _owner;
    interactionContract = Interaction(_interactionContractAddress);
    allowedContract = _interactionContractAddress;
  }

  modifier onlyOwner() {
    if (msg.sender == owner || msg.sender == allowedContract) _;
  }

  modifier onlyFirtsTime() {
    if (personInfo.id == 0) _;
  }

  function setInfo(
    string memory _firstName,
    string memory _secondName,
    string memory _email,
    uint _id,
    string memory _passportData
  ) public onlyFirtsTime {
    personInfo = PersonInfo(_firstName, _secondName, _email, _id, _passportData);
  }

  function setInfo(string memory _firstName, string memory _secondName, string memory _email, string memory _passportData) public onlyOwner {
    personInfo.firstName = _firstName;
    personInfo.secondName = _secondName;
    personInfo.email = _email;
    personInfo.passportData = _passportData;
  }

  function setName(string memory _firstName, string memory _secondName) public onlyOwner {
    personInfo.firstName = _firstName;
    personInfo.secondName = _secondName;
  }

  function setName(string memory _firstName) public onlyOwner {
    personInfo.firstName = _firstName;
  }

  function setEmail(string memory _email) public onlyOwner {
    personInfo.email = _email;
  }

  function setPassporData(string memory _passportData) public onlyOwner {
    personInfo.passportData = _passportData;
  }

  function getFirstName() public view returns(string memory) {
    return personInfo.firstName;
  }

}
